/* blogger.com - Ubuntu coffee beans                                                */
/* by Agnelo de la Crotche - 05.08.2008  - http://www.unixversal.com                */
/* This is a brown colored blogger.com style                                        */
/*                                                                                  */
/* other styles based on the same rules set:                                        */
/* blogger.com - Fedora slate blue      http://userstyles.org/styles/7348           */
/* blogger.com - Mandriva blue          http://userstyles.org/styles/7280           */
/*                                                                                  */
/* other Ubuntu Coffee beans styles:                                                */
/* wikipedia.org - Ubuntu coffee beans  http://userstyles.org/styles/6069           */
/*                                                                                  */
/* Wikipedia styles:                                                                */
/* wikipedia.org - Black & silver       http://userstyles.org/styles/6044           */
/* wikipedia.org - Ubuntu coffee beans  http://userstyles.org/styles/6069           */
/* wikipedia.org - chameleon green      http://userstyles.org/styles/6080           */
/* wikipedia.org - Mandriva blue        http://userstyles.org/styles/6083           */
/* wikipedia.org - Mepis blue           http://userstyles.org/styles/6110           */
/* wikipedia.org - Fedora slate blue    http://userstyles.org/styles/6157           */
/* wikipedia.org - Ubuntu Gold          http://userstyles.org/styles/6464           */
/*                                                                                  */
/* LCARS redesigned styles :                                                        */
/* Black Google in LCARS terminal               http://userstyles.org/styles/6738   */
/* Black Google in LCARS - supplemental         http://userstyles.org/styles/6906   */
/* wikipedia.or Start Trek LCARS terminal       http://userstyles.org/styles/6594   */
/* userstyles.org Star Trek LCARS redesigned    http://userstyles.org/styles/6510   */
/* Enjoy !                                                                          */
/* ~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~*/

@-moz-document domain(blogger.com),
               domain(blogspot.com){
html, html#header, body{background: #d48e56 url("data:image/png;base64,") top left repeat-x !important}









* {border-color: #7f4d25 !important}
:focus{outline: none !important}

/* ~~ hide all widgets except mini chat ~~~~~~~~~~~~~~~~~~ */
/* Comment out the following lines if you want to see blogger's widgets (slower!) */
.sidebar .HTML .widget-content>div:not([id="cboxdiv"]){display: none !important}
.sidebar .HTML .widget-content object{display: none !important}
.sidebar .HTML span, .sidebar .HTML h2{display: none !important}
.sidebar .Poll, .sidebar .Image, .sidebar .Text, .sidebar .VideoBar{display: none !important}

/* ~~ hide buttons background ~~~~~~~~~~~~~~~~~~~~~~~~~~~~~ */
.ubtn-small * {background-color: transparent !important; background-image: none !important}

/* blogger.com navigation bar ~~~~~~~~~~~~~~~~~~~~~~~~~~~~~*/
#b-navbar{background-color: #411e01 !important; color: #efb584 !important; border-bottom: 3px !important}
.Navbar, #b-search{background-color: #411e01 !important; background-image: none !important}
.btn, .btn div {border-color: #bb6721 !important; background-color: #c27b40 !important; color: #000000 !important}
.btn:hover, .btn div:hover {background-color: #ff9000 !important}
#b-query{border-color: #bb6721 !important}
#b-query{background-color: #f99a4c !important}
#b-navbar a:link{color: #ec9737 !important; font-weight: bold !important}
#b-navbar a:visited{color: #ec9737 !important; font-weight: bold !important}
#b-navbar a:hover{color: #ffb429 !important; font-weight: bold !important}

/* Flag tooltip */
#flagi, #flagi *{background-color: #fab054 !important}

#navbar-logo{background-image: url("data:image/png;base64,") !important}

/* Main page ~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~ */

#wrap, #wrap1, #wrap2, #wrap3, #wrap4, #outer-wrapper, #wrapper,
#main, #main2, #main3, #main4, #main-wrapper, #main-wrap1, #main-wrap2, #main-top,
.post *, .post-footer, .post-body, .post-title, #content-wrapper, h2.date-header, 
#header-wrapper, #header, #blog-header, #header h1, #navigation, #squeeze,
.right-corner, .right-corner *, .left-corner, .left-corner *, #h3, #m2,
body{background: transparent none !important; border: none !important}
#blog-title, #description, #m3{border-color: #fba25a !important}
#header, #header-wrapper{border: none !important}

h1{color: #ff9f1c !important}
h2{color: #ffb548 !important; padding-bottom: 10px !important}
h3{color: #000000 !important}
h2.title{color : #ffffff !important}
h2.date-header{color: #fce4ac !important}
.post, .post-body{ border-color: transparent !important}
.description{color: #fde4b2 !important}

.post-author, .vcard, .post-footer, .post-footer * {color: #7f593a !important}
.post-timestamp{color: #7f593a !important; text-transform: lowercase !important}
.post{border-bottom: 1px solid #96541e ! important}
.post img:not([class="icon-action"]){border: 1px solid #96541e ! important; background-color: #ba8960 !important}
.post span, .post div{color: #000000 !important}

a.timestamp-link, a.comment-link{color: #7f593a !important}
a.timestamp-link:hover, a.comment-link:hover{color: #ffffff !important}

/* footer  ~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~ */
#footer-wrapper, #footer, #footer-wrap1, #footer-wrap2, #footer *, #main-bot {background-image: none !important; background-color: transparent !important}
#footer, .feed-links{color: #381d07 !important}
#footer p span{color: #583f2c !important}
/* links */
a{color: #472c0f !important; background-color: transparent !important}
a:link{color: #7d3405 !important; font-weight: bold !important}
a:visited{color: #7d3405 !important; font-weight: bold !important}
a:hover{color: #3d1e09 !important; font-weight: bold !important}

/* sidebar ~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~ */
#sidebar-wrapper, #sidebar, .sidebar *, #profile-container, #profile-container *,
.box, .box1, .box2, .box3, .box4, .sidebar-title, #sidebar li
{background: transparent none !important; border: none !important}
img.profile-img{border: 1px solid #96541e ! important; background-color: #b26424 !important}
.profile-data{color: #873232 !important}
.profile-textblock{color: #873232 !important}
.sidebar .widget, .main .widget {border-bottom:1px dotted #a35414 !important}
.sidebar input[type="text"]{border: 1px solid #b48655 !important; background-color: #f7be51 !important}
#sidebar-wrap div {background: #f9ac59 none !important}
#sidebar-wrap>div, #sidebar-wrap>div>div  {-moz-border-radius: 20px !important; color: #000000 !important}
.widget-content img { background-color: #000000 !important}
.widget-content * { color: #000000 !important}

/* page not found & startpage ~~~~~~~~~~~~~~~~~~~~~~~~~~~~ */
.arrow-large-right .ubtn-orange-on-white div.ubtn,
.arrow-large-right .ubtn-orange-on-white span.ubtn span,
.arrow-large-right .ubtn-orange-on-white div.ubtn .i,
.arrow-large-right .ubtn-orange-on-white span.ubtn a{background-color: transparent !important;
background-image: url("data:image/png;base64,")!important; margin-left: -6px !important}

/* Chat Box  ~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~ */
#cboxmain, #cboxform {border-color: #c77f48 !important}

/* Icon replacements ~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~ */
img[src$="icon18_email.gif"]{height: 0px !important; width: 18px !important; padding-top: 18px !important;
background: url("data:image/gif;base64,R0lGODlhEgANAMIIAAABACcpJk4xGGVmZJtnOr5yM8WMXfGPQCwAAAAAEgANAAADQyi63H0wSrmImPgIK4rN0VYohXdhgDh25TcFQLnKJgTAAVyS8nYBg0EOEOONCLvbTTc70mQ5Fkn1LMQsK2pVxnF4GwkAOw==") no-repeat !important}

img[src$="openid-inputicon.gif"]{height: 0px !important; width: 16px !important; padding-top: 16px !important;
background: url("data:image/gif;base64,R0lGODlhEAAQAIQQAP9jAP9pEft4Kv6ygNLBusjLyODOw9HU0tzTzNze29zi5P/k1fLv6u3y9f727vz++////////////////////////////////////////////////////////////////yH+EUNyZWF0ZWQgd2l0aCBHSU1QACH5BAEKABAALAAAAAAQABAAAAVGICSOZGmeaKoug0oGgDsGgawYQIAo6FEUhBzhdyj9FA0HzQFR/AoiH+PxUNaihyLER63SUM7D1JpKEBGAmCpxIAhasng8BAA7") no-repeat !important}

img[id="lj-icon"]{height: 0px !important; width: 16px !important; padding-top: 16px !important;
background: url("data:image/png;base64,") no-repeat !important}

img[id="wp-icon"]{height: 0px !important; width: 16px !important; padding-top: 16px !important;
background: url("data:image/png;base64,") no-repeat !important}

img[id="aol-icon"]{height: 0px !important; width: 16px !important; padding-top: 16px !important;
background: url("data:image/png;base64,") no-repeat !important}

img[src$="/icon18_editdoc.gif"]{height: 0px !important; width: 16px !important; padding-top: 16px !important;
background: url("data:image/gif;base64,") no-repeat !important}

img[src$="plus_google.gif"]{height: 0px !important; width: 62px !important; padding-top: 18px !important;
background: transparent url("data:image/gif;base64,") no-repeat !important}
}

/* start page */
@-moz-document url-prefix(https://www.blogger.com/start){

/* header  ~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~ */
#header *{background: transparent !important}
#header label{color: #ffc78d !important}
#h2{border-bottom: 4px solid #894905 !important}
#h3{border-bottom: 0px !important}

#tag em{color: #edc990 !important}
#start-login-form input.text{border-color:#000000 #b48655 #b48655 #000000 !important; background-color: #f8d089 !important}
#header #language{border-color:#000000 #ff6600 #ff6600 #000000 !important; background-color: #dc9357 !important; color: #000000 !important}
#header option, #header option[selected]{background-color: #d98f0e !important; color: #000000 !important}
input[type="submit"]{border-color: #a46e4b #6e482e #6e482e #a46e4b !important; color: #e4ad5b !important}

/* body  ~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~ */
#main, #m2, #home, #primary{background: transparent none !important; color: #000000 !important}
#m3{border: none !important; color: #ffffff !important}
#main{border: 3px solid #865632 !important; -moz-border-radius: 20px !important; background-color: #b06329 !important}
h1{color: #000000 !important}
#primary p{color: #351b06 !important}
#secondary em{color: #f3c976 !important}

a{color: #943f06 !important}
a:hover{color: #ffffff !important}

/* Take a quick tour - button */
#home #primary #tour-btn, #home #primary #tour-btn div{background-image: none !important}
#home #primary #tour-btn{border : 3px solid #422618 !important; -moz-border-radius: 20px !important; background-color: #874424 !important}
#home #primary #tour-btn:hover {background-color: #fe6700 !important}
#home #primary #tour-btn div{background-color: transparent !important}
#home #primary #tour-btn div a span{color: #ffffff !important}

/* left and right arrows */
img[src$="img/arrow-right.gif"]{height: 0px !important; width: 14px !important; padding-top: 14px !important;
background: url("data:image/gif;base64,R0lGODlhDgAOAOMMAIlRLopTL4tUMIxVMo5YNZBaOJNePJZhP5hkQpllRJtoR51qSkcnEUcnEUcnEUcnESH+EUNyZWF0ZWQgd2l0aCBHSU1QACH5BAEKAA8ALAAAAAAOAA4AAARI8ElJACAzv2E7GJplGJ41CdaxKIUnSN2ALEtSmXdn0AtSEYHSRUFTAAQo4aB4zFkGu97vEYvaOpKkiuWaiEglDacE0lAsmEwEADs=") no-repeat !important}

img[src$="img/arrow-left.png"]{height: 0px !important; width: 14px !important; padding-top: 14px !important;
background: url("data:image/gif;base64,R0lGODlhDgAOAOMMAIpSL4xUMo5XNY9YNpBaOJNePJRfPpVgP5hjQplkRJtnR55rTEcnEUcnEUcnEUcnESH+EUNyZWF0ZWQgd2l0aCBHSU1QACH5BAEKAA8ALAAAAAAOAA4AAARI8EkpABAzv2A7CJpnFYY1cR2hLIcFPt2QLAuCAk8lIPRSiALOaqGoiD6A4c0T0PEWhuUFZpHRoh3JUsVyTY4kU0b60UyMmEwEADs=") no-repeat !important}

/* step 1,2,3  */
#step1{background-image: url("data:image/png;base64,") !important}


#step2{background-image: url("data:image/png;base64,") !important}




#step3{background-image: url("data:image/png;base64,") !important}






/* Publish - Get - Post - Go */
#w-pub{background: #5b3a22 url("data:image/png;base64,") no-repeat scroll center top !important}

#w-con{background: #5b3a22 url("data:image/png;base64,") no-repeat scroll center top !important}

#w-shr{background: #5b3a22 url("data:image/png;base64,") no-repeat scroll center top !important}

#w-pst{background: #5b3a22 url("data:image/png;base64,") no-repeat scroll center top !important}

#w-pub:hover, #w-con:hover, #w-shr:hover, #w-pst:hover{background-color: #000000 !important}
#home #primary td a, #home #primary td a strong{color: #ffffff !important}
}

/* leave a comment page ~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~ */
@-moz-document url-prefix(https://www.blogger.com/comment){

/* comments */
body{margin-bottom: 25px !important; color: #000000 !important}
#header{display: none !important}
h1{color: #653f0b !important;}
h2{text-align: left !important; padding-left: 0px !important; color: #ffcaa3 !important}
h4.total{color: #791f1f !important}
#wrap{width: 740px !important}
#wrap3{width: 100% !important; border: none !important}
#sidebar{width: 350px !important} 
#cbody{color: #000000 !important}
#wrap, #wrap2, #wrap3, #cform {background-image: none !important; background-color: transparent !important}
#wrap{background-color: #e8b168 !important; border: solid 4px #d67a2e !important;-moz-border-radius: 1em !important}
#main, #sidebar{background: #e8b168 none !important}
#btnAll{color: #8e552b !important}
#btnAll:hover{color: #ffffff !important}
.msg, .saved{background-color: transparent !important; color: #ffffff !important}

img.profile{border: 1px solid #96541e ! important; background-color: #b26424 !important}
.comment-timestamp{color: #955e32 !important}
#comments-block dd{border-bottom: 1px solid #5a3b24 !important; color: #000000 !important} 
#comments-block dd p {color: #000000 !important}
#comments-block dt, #comments-block dt span{color: #815839 !important}
#comments-block dt#preview-header, #comments-block dd#preview-main {background-color: #d78544 !important}

/* sidebar */
#sidebar, #cbody{border:none !important}
#cform{background-color: #d26e21 !important; border: solid 2px #893e04 !important; -moz-border-radius: 20px !important}
#cform .form-title{background-image: none !important}
h2.sidebar-title{color: #f3c260 !important}
textarea#comment-body{background-color: #f7be51 !important; height: 250px !important}
#sidebar2 #cbody #buttons {border: none !important}
input.text, input[type="text"], select[id="openIdDropDown"]{border-color:#000000 #b48655 #b48655 #000000 !important; background-color: #f7be51 !important}
h3 label{color: #492000 !important}

#publishBtn .i, #publishBtn-hidden, #previewBtn .i, #previewhBtn-hidden
{background-color: #853b20 !important; border: solid 1px #591507 !important; -moz-border-radius: 20px !important}
#publishBtn .i:hover, #publishBtn-hidden:hover, #previewBtn .i:hover, #previewhBtn-hidden:hover{background-color: #b13509 !important}

/* links */
#wrap3 a:link{color: #a0300f !important; font-weight: bold !important}
#wrap3 a:visited{color: #a0380f !important; font-weight: bold !important}
#wrap3 a:hover{color: #ffffff !important; font-weight: bold !important}
#bloggerloginform a:link{color: #9e2f07 !important; font-weight: bold !important}
#bloggerloginform a:hover{color: #ffffff !important; font-weight: bold !important}
a[onclick], a[onclick] *{color: #f78131 !important}
a[onclick]:hover, a[onclick] *:hover{color: #ffffff !important; text-decoration: none !important}
#preview-actions a[onclick], #preview-actions a[onclick] *{color: #a0300f !important; text-decoration: none !important; font-size: 90% !important}
#preview-actions a[onclick]:hover, #preview-actions a[onclick] *:hover{color: #3d160b !important}
}

/* content warning ~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~ */
@-moz-document url-prefix(https://www.blogger.com/blogin){
#header{display: none !important;}
#main{margin-top: 150px !important;}
#main, #m2, #m3, .mod{background: transparent none !important; border: none !important}
.mod, #m2{border: solid 2px  #a35623 !important;-moz-border-radius: 20px !important; background-color: #6f0c0c !important}
.mainClm *{color : #f1dea3 !important;}
.mainClm h1{color : #ff0000 !important; padding: 5px !important; text-align: center !important;}
.mod a, #m3 a, .mainClm p a{color: #ff822d !important;}
.mod a:hover, #m3 a:hover,.mainClm p a:hover{color: #ffffff !important;}
#continueButton, #exitButton{background-color: #853b20 !important; border: solid 1px #591507 !important; -moz-border-radius: 20px !important}
#continueButton:hover, #exitButton:hover{background-color: #b13509 !important}
a[onclick], a[onclick] *{color: #000000 !important}
a[onclick]:hover, a[onclick] *:hover{color: #ffffff !important; text-decoration: none !important}
}

/* profile page ~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~ */
@-moz-document url-prefix(http://www.blogger.com/profile){
#header{display: none !important;}
#main-wrap *, #sidebar *, #footer *{background-color: transparent !important; border-color: #c77f48 !important;background-image: none !important;}
#main, #m3, .mod3{background: transparent none !important; border: none !important}
#m2, #sidebar .mod3{border: solid 2px  #a35623 !important;-moz-border-radius: 20px !important; background-color: #d2883a !important; color: #ffffff !important}
#sidebar .mod3 {background-color: #593127 !important; color: #eed390 !important}
#m3 h1 { color: #632110 !important;}
#sidebar .mod3 h2{color: #ffffff !important}
#sidebar .mod3 th{color: #ccb591 !important}
#sidebar .mod3 td{color: #f2cc92 !important}
#sidebar .mod3 a{color: #d87c24 !important}
#sidebar .mod3 a:hover{color: #ffffff !important}
}

/* mini chat ~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~ */
@-moz-document domain(cbox.ws){
body{background-color: #9b460c !important}
#bdy{background-color: #af6634 !important}
#mt{background-color: #e29b43 !important}
.stxt, .stxt *{background-color: #e29b43 !important; color: #000000 !important}
.stxt2, .stxt2 *{background-color: #fab054 !important; color: #000000 !important}
.dtxt, .dtxt2 {color: #9d4c16 !important}
input{background-color: #ffa86d !important}
input.frmbtn{background-color: #653717 !important; color: #ffb577 !important}
a:link{color: #422c13 !important; font-weight: bold !important}
a:visited{color: #422c13 !important; font-weight: bold !important}
a:hover{color: #ffffff !important; font-weight: bold !important}
}

/* Google account page (joke !) ~~~~~~~~~~~~~~~~~~~~~~~~~~~~ */
@-moz-document url-prefix(https://www.google.com/accounts),
               url-prefix(https://www.blogger.com/comment){
img[src$="google_small_accounts.gif"]{height: 44px !important; width: 0px !important; padding-left: 113px !important;
background: url("data:image/gif;base64,") no-repeat !important}

img[src^="https://www.google.com/accounts/Captcha"],img[src^="/captcha"]
{height: 70px !important; width: 0px !important; padding-left: 200px !important;
background: url("data:image/jpg;base64,") no-repeat !important}
}
